const root= createRoot(document.getElementById("root"))
const root2= createRoot(document.getElementById("root2"))
const image= createRoot(document.getElementById("image"))

function App(){
  return ( <div>
  <Nav/>
  <Search></Search>
  <Pic></Pic>
</div>
  )
}
function Nav(){
  return(<nav>
    <h1>Perfumy</h1>
    <ul>
        <li>
           Home | </li>
        <li>Products | </li>
        <li>About | </li>
        <li>Contact | </li>
    </ul>
    </nav>
    )
}


function Search(){
  return (<div className="searchbar">

  <input type="text" placeholder="Search"/>  
</div>);

}
